import React from 'react';

const TweetList = (props) => {
	const tweetItems = props.tweet.map((tweet) => {
		return (
			<li>
				<tweetItem key={tweet.id} />
			</li>
			)
	});

	return (
		<ul>
			{tweetItems}
		</ul>
		)
};

export default TweetList;
